const Nav = () => {
    return(
    <div className="nav-container">
        <div className="text-content">
        <h1>Hunt Your New Home</h1>
        <p>Find your dream rental in a city near you. </p>
    </div>
    <div>
    <nav className="search-bar" style={{display: "inline"}}>
        <form className="form-inline">
        <input className="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" />
        <button className="btn bg-light my-2 my-sm-0" type="submit" style={{float: "right"}}>Search</button>
        </form>
    </nav>
    </div>
    </div>
    );
}
export default Nav;
